import './App.css';
import { useState } from 'react'

let command = ''

const handleInput = (e) => {
  return e.target.value
}

let q = command

function App() {


  return (
    <div class='App'>
      <History
       input={handleInput}
      />
      <input onChange={handleInput}/>
      <button /*onClick={handleClick}*//>
    </div>
  )
}

function History(input) {

  const [history, setHistory] = useState('')


  setHistory({input})


  return (
    <ul>
      {history}
    </ul>
  )
}



export default App;
